import TaskList from "./components/TaskList";
import TaskForm from "./components/TaskForm";

function App() {
  return (
    <main className="bg-zinc-900 h-screen">
      <div>
      <TaskForm />
      <TaskList />
      </div>
    </main>
  );
}

export default App;
